import React from 'react';
import { AppBar, Button, Tab, Tabs, Toolbar, Typography } from '@mui/material'
import MedicalServicesIcon from '@mui/icons-material/MedicalServices';
import ShoppingCartSharpIcon from '@mui/icons-material/ShoppingCartSharp';
import { Outlet, Link } from "react-router-dom";
const Header = () => {
    return (
        <React.Fragment>
            <AppBar position="sticky" elevation={0}>
                {/* <Toolbar> */}
                    <MedicalServicesIcon />
                    <Typography sx={{ padding: "10px" }}>Welcome to Med/Pharma</Typography>
                    {/* <Tabs textColor='1px solid white'>
                            <Tab label="Home" /> 
                             <Tab label="About" />
                            <Tab label="Contact" />
                        </Tabs> */}
                    <nav>
                        <ul>
                            <li>
                                <Link to="/">Home</Link>
                            </li>
                            <li>
                                <Link to="/blogs">Blogs</Link>
                            </li>
                            <li>
                                <Link to="/contact">Contact</Link>
                            </li>
                        </ul>
                    </nav>
                    <Outlet />
                    {/* <h2><Link href="/">Link</Link></h2>
                           <h2>Home</h2> */}
                    <Button variant="contained" sx={{ marginLeft: "37rem" }}>Login</Button>
                    <ShoppingCartSharpIcon sx={{ marginLeft: "auto" }} />
                {/* </Toolbar> */}
            </AppBar>
        </React.Fragment>

    )
}

export default Header;
